import { isEmpty } from "lodash"
import { useRouter } from "next/router"
import { useEffect } from "react"

export default function Home() {
  const router = useRouter()

  useEffect(() => {
    console.log(isEmpty(window.localStorage.getItem('isToken')))
    if (isEmpty(window.localStorage.getItem('isToken'))) return router.push('/login')
  })

  return (
    <></>
  )
}
